import { Col, Row } from 'react-bootstrap';
import { FaStar } from 'react-icons/fa';

export default function Rating ({ rating, voteCount}) {
    return (
        <div>
            <Col>
                <FaStar color='yellow'/>
            </Col>
            <Col>
                <Row>
                    <span style={{fontSize: '1.5rem'}}>{rating}</span>
                    <span style={{fontSize: '.8rem', opacity: '0.7'}}>/10</span>
                </Row>
                <Row>{voteCount}</Row>
            </Col>
        </div>
    )
}
